import React from 'react'
import { popularProducts } from '../../Data'
import Product from './Product'
import { Container, Image } from './productsStyle'
function Products() {
    return (
        <div>
            {popularProducts.map((item) => (
                <Product key={item.id} item={item} />
            ))}
        </div>
    )
}

export default Products
